import React from "react";
import Projects from "../Projects/Projects";
import MainProjects from "../MainProjects/MainProjects";

import Footer from "../Footer/Footer";
// import Box from "@material-ui/core/Box";
import Skills from '../Skills/Skills'
import CallToAction from '../CallToAction/CallToAction';
// import WordTransition from '../WordTransition/WordTransition'
import {Parallax, ParallaxLayer} from 'react-spring/renderprops-addons'


const url = (name, wrap = false) => `${wrap ? 'url(' : ''}https://awv3node-homepage.surge.sh/build/assets/${name}.svg${wrap ? ')' : ''}`
const Pink = ({ children }) => <span style={{ color: '#FF6AC1' }}>{children}</span>
const Yellow = ({ children }) => <span style={{ color: '#EFF59B' }}>{children}</span>
const Lightblue = ({ children }) => <span style={{ color: '#9AEDFE' }}>{children}</span>
const Green = ({ children }) => <span style={{ color: '#57EE89' }}>{children}</span>
const Blue = ({ children }) => <span style={{ color: '#57C7FF' }}>{children}</span>
const Gray = ({ children }) => <span style={{ color: '#909090' }}>{children}</span>
const Home = () => {
  return (
      <>
    {/* <Box component="div" style={{ background: "#5f5b60", height: "100vh" }}> */}
    <Parallax pages={3} scrolling={false} horizontal ref={ref => (this.parallax = ref)}>
  <ParallaxLayer offset={0} speed={0.5} onClick={() => this.parallax.scrollTo(1)}>
    <span onClick={() => this.parallax.scrollTo(1)}> <CallToAction/></span>
  </ParallaxLayer>
</Parallax>

{/* <WordTransition/> */}
<MainProjects/>

      <Skills/>
      <Projects />
      <Footer />
    {/* </Box> */}
    </>
  );
};

export default Home;
